import { NavLink } from "react-router-dom";
import { FaShoppingCart } from "react-icons/fa"

const Navbar = () => {
  return <div>
    {/* Logo */}
    <div>
      <img src="	https://clipground.com/images/google-shopping-logo-clipart-6.jpg" alt="" width={130} height={100} />
    </div>

    <div>
      <NavLink to="/">
        <p>Home</p>
      </NavLink>

      <NavLink to="/cart">
        <FaShoppingCart></FaShoppingCart>
      </NavLink>

    </div>

  </div>;
};

export default Navbar;
